USE eledford;

--Drops genes and proteins if they already exist in the database
DROP TABLE IF EXISTS genes;

DROP TABLE IF EXISTS proteins;

--The DDL to create tables for genes and proteins
-- Data from NCBI: accession_number_gene, gene_symbol, full_name, organism, last_updated, location, bp_length, gene_type
-- and sequence for the genes table
-- Data from Ensembl: num_associated variants, num_highest_variant, highest_disease_variant for genes table
-- Data from Uniprot: associated_protein for the genes table
CREATE TABLE genes (
	accession_number_gene varchar(100),
	gene_symbol varchar(100),
	full_name varchar(1000),
	associated_protein varchar(100),
	organism varchar(100),
	last_updated varchar(100),
	location varchar(100),
	bp_length varchar(100),
	gene_type varchar(100), 
	sequence varchar(3000),
	num_associated_variants int,
	num_highest_variant varchar(100),
	highest_disease_variant varchar(100),
	PRIMARY KEY (accession_number_gene)
);

-- Data from Uniprot: accession_number_prot, full_name, associated_geneSymbol, organism, last_updated, location, aa_length,
-- and sequence for the proteins table
CREATE TABLE proteins (
	accession_number_prot varchar(100),
	full_name varchar(100),
	associated_geneSymbol varchar(100),
	organism varchar(100),
	last_updated varchar(100),
	location varchar(1500),
	aa_length varchar(100),
	sequence varchar(1000),
	PRIMARY KEY (accession_number_prot)
);

